Starring Aja, Taylor Wane, Heather Hart, Cameo, Daphne, Johnny Nineteen, Marc Wallice, Jerry Butler, Tom Chapman

The fourth edition of the series once again centers on Cameo, now firmly ensconced as one of the most important women in the mob. She's still with Don Joey Silvera, but now she's found passion in the arms of much-younger Johnny Nineteen. Horny hitwoman Taylor Wayne is also back, wielding her massive mams and hefty gun as she blows away every man -- or woman -- who gets in her way. Meanwhile, Aja returns as Cameo's lusty aunt, making nice with a local barkeep to help keep her mind off her family's plight. While the storyline isn't as strong as in previous edition, the sex is every bit as alluring. Cameo, Aja and Taylor are a trio that's hard to beat, and their passions keep this one boiling throughout
